import React, { Component } from 'react'
import {Card, Col, Row} from 'react-bootstrap';
import logo from './logo512.png'
import './home.css';

class Home extends Component{
    render(){
        return(
            <div className="HomepageCard">
               <Card style={{ width: '100%' }} >
                    <Row>
                        <Col lg={4} xs={12} className="mr-0 ml-0">
                            <Card.Img variant="top" src="holder.js/100px180" style={{ padding: '6px', border:'1px solid grey', margin:'10px', height:'200px', width:'250px' }} />
                        </Col>
                        <Col lg={8} xs={12} className="mr-0 ml-0">
                            <Card.Body>
                                <Card.Title>Card Title</Card.Title>
                                <Card.Text>
                                    Some quick example text to build on the card title and make up the bulk of
                                    the card's content.
                                <Badge pill variant="primary">
                                    Primary
                                </Badge>
                                </Card.Text>
                            </Card.Body>
                        </Col>
                    </Row>
                </Card>
            </div>
        );
    }
}

export default Home;
